import React from 'react';
import '../css/titulo.css';
import logo from './img/1.webp'; // Ruta relativa a Titulo.js

const Titulo = () => {
  return (
    <div className="titulo-contenedor">
      <img src={logo} alt="Logo" className="logo" />
      <div>
        <h1 className="titulo-principal">Catálogo Diseños Stely</h1>
        <p className="subtitulo">Empresa nortesantandereana con calidad y elegancia</p>
      </div>
    </div>
  );
};

export default Titulo;
